import React, { Component } from 'react';
import './App.css';
import Slider from './components/Slider';
import RightArrow from './components/RightArrow';

class App extends Component {
    constructor(props) {
        super(props)

        this.state = {}
    }

  render() {
    return (
        <div>
            <Slider />
            <RightArrow />
        </div>
    );
  }
}

export default App;
